import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (simulate clicking the cart icon)
    // The cart icon is a div with class 'cart'
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Wait for at least one cart item to be present (if any)
    // Cart items have class 'cart-item'
    const cartItemSelector = '.cart-item';
    await page.waitForSelector(cartItemSelector, { timeout: 5000 });

    // Take screenshot of cart before update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_before_update.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_before_update.png'));

    // Find the first cart item's quantity span and the plus button
    // Quantity: '.cart-item .quantity'
    // Plus button: '.cart-item .quantity-btn' (the second button, after the minus)
    const cartItems = await page.$$(cartItemSelector);
    if (cartItems.length === 0) {
      throw new Error('No cart items found to update');
    }
    const firstCartItem = cartItems[0];

    // Extract the current quantity
    const quantitySpan = await firstCartItem.$('.quantity');
    const quantityText = await quantitySpan.innerText();
    const oldQuantity = parseInt(quantityText);

    // Click the plus button to increase quantity by 1
    const quantityBtns = await firstCartItem.$$('.quantity-btn');
    if (quantityBtns.length < 2) {
      throw new Error('Quantity plus button not found');
    }
    // The plus button is the second button
    await quantityBtns[1].click();

    // Wait for the quantity to update (should increment by 1)
    await page.waitForFunction(
      (selector, oldQty) => {
        const el = document.querySelector(selector);
        return el && parseInt(el.innerText) === oldQty + 1;
      },
      {},
      '.cart-item .quantity',
      oldQuantity
    );

    // Take screenshot after update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_after_update.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_after_update.png'));

    // Extract the new quantity and product title for verification
    const newQuantityText = await quantitySpan.innerText();
    const newQuantity = parseInt(newQuantityText);
    const productTitleEl = await firstCartItem.$('.cart-item-title');
    const productTitle = productTitleEl ? await productTitleEl.innerText() : '';

    return {
      success: true,
      action: "Updated cart item quantity by increasing it by 1",
      extractedData: {
        productTitle,
        oldQuantity,
        newQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
